import React from "react";
import { YMaps } from "react-yandex-maps";

import Map from "./Map";
import MapBody from "./MapBody";

function MapComponent() {
  return (
    <div>
      <YMaps query={{ apikey: "f3c78576-996b-4eaa-84f8-12a8520d276a" }}>
        <MapBody />
      </YMaps>
    </div>
  );
}
export default MapComponent;
